  IMACLEAN, Margaret Esther and KLEE, Victor George
  OD . )
  01> MACLEAN, Margaret Esther m on 24.04.1954 to KLEE, Victor George
  b 11.01.1923
  b 18.09.1909 d 25.01.1981
  Margaret b. at Gisborne and m. at Wellington. Victor, s/o George Klee (army) and Gertrude Violet Martha
  Foley, b. and d. at Wellington and bd. at Karori, Address: 123 Onepu Road, Wellington 3.
  Margaret was educated at Chilton Saint James and spent two years in the land army, two years in the UK
  and a year in Tasmania. She was a Burroughs operator/ accounts clerk and Victor was a printer.
  01> KLEE, Lionel Victor m on 16.04.1977 to PECK, Margaret Lynn
  b 04.12.1954
  b 20.07.1956
  Lionel b. at Wellington and m. at Raetihi. Lynn, d/o Rev Robert Peck and Margaret Cooper, b, at
  Ohio, USA. She emigrated with her parents to Taranaki in 1964. Address: 35 Glen Road, Kelburn,
  Wellington,
  Lionel was educated at Seatoun Primary, Friends School, Wanganui, Rongotai College and Victoria
  University of Wellington (BA(Hons)Geography). Between 1977 and 1985 he worked for the Town and
  Country Planning Division of the Ministry of Works and Development in economic and regional
  planning. This included two years at Nottingham University where he completed an MA(Environmental
  Planning). Lionel developed an interest and skills in computing, and in 1985 he joined Databank
  Systems. In 1987 he moved to Bull Information Systems as a systems consultant, followed by three
  years at Capital Coast Health. Since 1996 Lionel has undertaken contract work as an information
  technology consultant.
  Lynn was educated at Manaia Primary School, Taranaki; Wadestown Primary School and St Mark's
  School, Wellington; Wellington Girls' College and Victoria University (BA(Hons) in English
  Literature). Lynn has worked for various government departments and service organisations in public
  relations and media positions and, since 1986 has run a freelance editorial and publishing
  business.
  01> KLEE, Rebecca Ellen
  b 19.02.1982
  Rebecca b. in Wellington. She was educated at Kelburn Primary School and Wellington East
  Girls' College.
  02> KLEE, Anika Margaret
  b 10.02.1984
  Anika b. in Wellington. She was educated at Kelburn Primary School and Wellington East Girls'
  College.
  02> KLEE, Susan Alison m on 07.01.1978 to HAVER, Anthony Henry Peter
  b 21.03.1959
  b 02.05.1956
  Alison b. and m, at Wellington. Anthony, s/o Peter Haver and Helen Buis, b. at Wellington. Address:
  410 Broadway, Miramar, Wellington 3.
  Alison was educated at Seatoun Primary School, Evans Bay Intermediate and Queen Margaret College.
  She has worked in a bank and as an accounts administrator for several firms and currently works in
  this position for the Institution of Professional Engineers. Her interests include oil painting,
  reading and dancing.
  Anthony was educated at St Patrick's College, Wellington, and worked for the Post Office as a radio
  technician for several years. He now works as Victoria University.
  01> HAVER, Benjamin Victor Peter
  b 24.01.1981
  Benjamin b. in Wellington. He attended Holy Cross Primary School and is now at St Patrick's
  College, Wellington.
